column8:
ポーランドから可愛いお皿が入荷しました。<BR>
お醤油皿としても使える、<BR>
やや深さのあるミニプレート。<BR>
真ん中にちょこんとスタンプされたリンゴが<BR>
かわいらしいですね。<BR><BR>

【製品の特徴】<BR>
 ●耐久性に優れ、傷がつきにくい。<BR>
 ●電子レンジ、食器洗乾燥はもちろん、オーブンにも直接使用できます。<BR><BR>


■サイズ（cm）<BR>
直径：約10.5cm <BR>
高さ：約2.1cm（外寸） <BR>

Fabryka Naczyn Kamoinkowych Manufaktura社<BR>
ポーランド製<BR><BR>



<TABLE border="1" width="400"><TR>
<TD>知っていただきたい事</TD></TR><TR><TD>

ポーランド陶器は、ひとつひとつが職人の手作業で成型、絵付けされいますので、
同じ商品でも、柄の細かい部分が微妙に異なっています。
また、絵付けの際の絵具の散り、スタンプのずれ、ちいさなくぼみ、多少のざらつき、釉薬をかけた際の気泡によるピンホールなどはメーカー良品基準内となっております。
工業製品とは違ったハンドメイドならではの特徴としてご了承いただきますようお願い致します。<BR>

良品のみをお届けしておりますので、輸送中の破損以外は、返品・交換には対応できません。ご理解の上、お買い求めください。<BR><BR>
当店は正規代理店を通して輸入、日本の食品衛生法検査に合格した商品だけを販売しております。</TD><TR>

</TR></TABLE><br>



